// src/pages/AboutPage.js
import React from 'react';
import AboutMe from '../components/AboutMe';
import KineticTypography from '../components/KineticTypography';
import MicroInteractions from '../components/MicroInteractions';
import './AboutPage.css';

const AboutPage = () => {
    return (
        <div className="about-page">
            <h1>About Me</h1>
            <AboutMe />
            <KineticTypography />
            <MicroInteractions />
            <section className="values">
                <h2>My Values</h2>
                <p>
                    I believe in continuous learning, collaboration, and creating technology that makes a positive impact on people's lives.
                    I am passionate about leveraging AI and data science to drive innovative solutions in every project I undertake.
                </p>
            </section>
        </div>
    );
};

export default AboutPage;
